void utf8::uppercase(const char* str, std::string& out) {
  char32_t chr;
  while ((chr = decode(str)))
    append(out, uppercase(chr));
}

void utf8::uppercase(const char* str, size_t len, std::string& out) {
  char32_t chr;
  while (len) {
    chr = decode(str, len);
    append(out, uppercase(chr));
  }
}

void utf8::lowercase(const char* str, std::string& out) {
  char32_t chr;
  while ((chr = decode(str)))
    append(out, lowercase(chr));
}

void utf8::lowercase(const char* str, size_t len, std::string& out) {
  char32_t chr;
  while (len) {
    chr = decode(str, len);
    append(out, lowercase(chr));
  }
}

